import React, { Component } from 'react';
import Link from 'next/link';
import logo from '../static/logo.png';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Card, CardText, CardHeader, CardBody, Button } from 'reactstrap';

class Header extends Component{

    render(){
        return(

            <div>


                <nav className = 'navbar navbar-default'>
                    <div className = 'container-fluid'>
                    <Logo/>
                    <Menu/>
                    </div>
                </nav>

                <style jsx>{`

                `}</style>
            </div>
        );
    }
}

const Logo = props => (
    <div className = 'navbar-header'>
        <Link href = '#'>
            <a className = 'navbar-brand'>
                        {/*<img src={require(logo)} />*/}
                        <img src={logo} alt = ''/>
            </a>
        </Link>
        <style jsx>{`
                    img{
                        width: 30px;
                        height: 30px;
                        background: #004650;
                    }

                `}</style>


    </div>
);

const MenuButton = props =>(
    <Link href = {`${props.href}`}>
        <li><a className = 'navbar-brand'>{`${props.name}`}</a></li> 
    </Link>
);

const Menu = props =>(
    <ul className = 'nav navbar-nav'>
        <MenuButton name = 'Main' href = '#'/>
        <MenuButton name = 'Songs' href = '#'/>
        <MenuButton name = 'Compositors' href = '#'/>
        <MenuButton name = 'Chords' href = '#'/>
        <MenuButton name = 'Articles' href = '#'/>
    </ul>


);

export default Header;
